import React from "react";
import { useContext } from "react";
import { PetContext } from "../context";


// const getUnique = (items, value) => {
//   return [...new Set(items.map(item => item[value]))];
// };
export default function PetFilter({ pets }) {
   const context = useContext(PetContext);
   const {
     handleChange,
     age,
     maxAge,
     minAge,
   } = context;
  // let genders = getUnique(pets, "gender");
  // genders = ["all", ...genders];
  // genders = genders.map((item, index) => {
  //   return (
  //     <option value={item} key={index} >
  //       {item}
  //     </option>
  //   );
  // });
   return (
      <section className="col-md-9 offset-3 padding-tb">
      {/* <Title title="Filter" /> */}
      <br/>
      <form className="row filter-form">
        <div className="col-md-3 form-group">
          <label htmlFor="gender">select Gender</label>
          <select
            name="gender"
            id="gender"
            className="form-control"
            onChange={handleChange}
          >
            <option value="all">All</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </select>
        </div>
        <div className="col-md-6 form-group age-slider">
        <label htmlFor="age" className="select-age"> Select Age</label>
        <input
          type="range"
          name="age"
          min={minAge}
          max={maxAge}     
          id="age"
          onChange={handleChange}
          className="form-control-range"
        />
        <label htmlFor="age">{age} Months old</label>
      </div> 
      </form>
      </section>
  );
}
